In celebration of its 65th anniversary, the House of Ideas proudly presents a timeless testament to another true Marvel visionary! Best known as the first artist to bring Spider-Man to life in the pages of AMAZING FANTASY, Steve Ditko illustrated AMAZING SPIDER-MAN for four years - helping create characters such as Doctor Octopus, the Lizard, the Vulture and dozens more of Spider-Man's classic villains. In contrast to the grounded realism of Spider-Man, Ditko also drew the adventures of Doctor Strange, a master of the mystic arts who defended Earth's citizens from bizarre otherworldly threats. Now, this deluxe keepsake edition collects his greatest moments - including stories from TALES TO ASTONISH #26 and #42; STRANGE TALES #94, #97, #110, #115, #126, #127 and #146; AMAZING ADULT FANTASY #7, #10, #12, #13 and #14; AMAZING SPIDER-MAN #1, #31-33 and ANNUAL #1; HULK #6 and #249; TALES OF SUSPENSE #48; DAREDEVIL #162;
MARVEL SUPER-HEROES SPECIAL; and SPEEDBALL #1.
336 PGS./All Ages ...$29.99
